var _ingredientData = {
  '1': {
    name: 'Pork Roast'
  },
  '2': {
    name: 'Elbow Macaroni'
  },
  '3': {
    name: 'Dried Jalepeno Flakes'
  },
  '4': {
    name: 'BBQ Sauce'
  },
  '5': {
    name: 'Cheese'
  }
}

Object.keys(_ingredientData).forEach(function(key) {
  _ingredientData[key].id = key;
})

export default _ingredientData;
